INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5014328042975', 'tetley', 'T Une touche de gourmandise oujours partant pour relever de nouveaux défis, Tetley s\'est appliqué à révéler la délicatesse du thé vert en lui enlevant toute once d\'amertume. Un tour de force rendu possible grâce à une méthode inspirée de la tradition asiatique: les feuilles de the sont soigneusement placées dans un bain de vapeur pour produire un the vert à la saveur douce et rafraichissante. Pour des sensations encore plus inédites, Tetley complète sa Collection Delicate par la saveur fruits rouges. Un thé gourmand aux notes fruitées de framboise et de mûre. Thé vert aromatisé. Ingrédients: Thé vert* étuvé [Chine] (89%), arome naturel de mùre avec autres arômes naturels (5%), arôme naturel, framboise [Europe](1%) Gourmet Süße etreu der Unternehmensphilosophie, stets neuen Herausforderungen zu begegnen, hat Tetley sich ein neues ehrgeiziges Ziel gesetzt: Der feine Charakter von Grüntee soll - ohne auch nur einen Hauch von Bitterstoffen - zur Geltung kommen. Eine wahre Meisterleistung, die durch ein Dampfbad ermöglicht wird, in das die Teeblätter mit großer Sorgfalt gelegt werden. Mithilfe dieser an eine asiatische Tradition angelehnten Methode entsteht ein milder und erfrischender Grüntee. Auf der Suche nach weiteren neuen Geschmackserlebnissen erweitert Tetley seine Collection Délicate um die Sorte Brombeere und Himbeere. Ein Tee mit einem Hauch Herbheit, verfeinert um eine überraschend milde Note. Aromatisierter grünertee. Zutaten: Grüner Tee* [China] (89.0%), natürliches Brombeer aroma mit anderen natürlichen Aromen (5%), natürliches Aroma, Himbeere (Europa) (1.0%) Vérifié Rainforest Alliance/Rainforest-Alliance-zertifiziert. Tetley Tetley Tetley 0oll Bon Dx liente Cllertion Dehmt fh vert t Cdlertion Dyliealk Thd yert &tuve Laissez-vous tenter par les autres varietés de notre gamme Collection Délicate en nous retrouvant sur www.tetley.com Werwöhnen Sie sich mit unseren anderen königlichen Sorten, die Sie auf www.tetley.com finden können.', 'https://static.openfoodfacts.org/images/products/501/432/804/2975/front_fr.13.400.jpg', '', '', '', '', '', '', '', '', '', '1');

